window.addEventListener("load",(()=>{this.document.querySelectorAll("a.copy-data-button").forEach((t=>{t.addEventListener("click",(function(){const e=t.textContent;navigator.clipboard.writeText(t.getAttribute("copy-data")).then((()=>{t.textContent="Copied content",setTimeout((()=>{t.textContent=e}),5e3)}),(()=>{t.textContent="Failed to copy",setTimeout((()=>{t.textContent=e}),5e3)}))}))}))}));